<!DOCTYPE html>
<html>
<head lang="en">
    <meta charset="UTF-8">
    <title></title>
    <script src="../../js/execute.js"></script>
    <script src="//cdn.jsdelivr.net/jstat/1.2.1/jstat.min.js"></script>
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/2.1.3/jquery.min.js"></script>
    <script src="underscore_before.js"></script>


</head>
<body>
<p>First version of object comparison</p>

<div id="message"></div>


<script>

    var obj1 = {a: 'a', b: 'b', c: 'c'};
    var obj2 = {a: 'a', b: 'b'};
    var obj3 = {a: 'a', b: 'b', d: 'd', e:'e'};

    var f1 = function () {
        for (var i=0; i<=10000; i++) {
            _.isEqual(obj1, obj2);
            _.isEqual(obj2, obj3);
            _.isEqual(obj3, obj1);
        }
      };




    var a = execute(f1, 10);
    var mean=mean(a);


    $.ajax({
        url: 'http://localhost:8081',
        data: JSON.stringify({'mark':0,'mean':mean}),
        type: 'POST',
        contentType: 'application/json',
        success: function (data) {

            $('#message').html('done, close browser');


            console.log('Success: ')
        },
        error: function (xhr, status, error) {
            console.log('Error: ' + error.message);

        }
    });

</script>

</body>

</html>
